document.addEventListener('DOMContentLoaded', function() {
  // 初始化所有嵌套UL的显示属性为'none'
  var nestedUls = document.querySelectorAll('.tree ul ul');
  nestedUls.forEach(function(ul) {
    ul.style.display = 'none';
  });

  // 为所有的toggle按钮添加点击事件监听器
  var toggles = document.querySelectorAll('.tree .toggle');
  toggles.forEach(function(toggle) {
    toggle.addEventListener('click', toggleChildren);
  });

  // 为所有的节点添加点击事件监听器
  var nodes = document.querySelectorAll('.tree .node');
  nodes.forEach(function(node) {
    node.addEventListener('click', function(event) {
      event.stopPropagation(); // 阻止事件冒泡

      // 移除当前激活节点的激活状态
      var currentNode = document.querySelector('.tree .node.active');
      if (currentNode) {
        currentNode.classList.remove('active');
      }

      // 给点击的节点添加激活状态
      node.classList.add('active');

      showNodeInfo(node.id);
    });
  });
});


